   "source": [
    "This exploratory analysis aims to establish the\n",
    "relation of some health markers and the cardiovascular health of the population. It studies heart\n",
    "disease risk by focusing on key indicators such as BMI, smoking, physical activity, and alcohol\n",
    "consumption. The dataset, which initially comprised nearly 20 variables, has been narrowed\n",
    "down to 10 for the analysis. Ultimately, the project\n",
    "aims to provide valuable insights into the factors that are closely associated with\n",
    "heart illness.\n"
   ]
  },
