   "source": [
    "To begin the analysis, the \"heart_2020_cleaned.csv\" dataset is imported into R. Some columns (Asthma, KidneyDisease, SkinCancer, Stroke,Diabetic, -DiffWalking) are removed as they are chosen to be irrelevant to the analysis. Despite the initial cleanliness of the dataset, precautionary measures are taken to check for any missing values. "
