    "# Reading the dataset and dropping specified columns as they are not used in the analysis\n",
    "data <- read.csv(\"/kaggle/input/personal-key-indicators-of-heart-disease/2020/heart_2020_cleaned.csv\") %>%\n",
    "  select(-Asthma, -KidneyDisease, -SkinCancer, -Stroke, -Diabetic, -DiffWalking)\n",
    "print(unique(data$GenHealth))\n",
    "# Checking for missing values\n",
    "if (sum(is.na(data)) > 0) {\n",
    "  cat(\"Warning: There are missing values in the dataset.\\n\")\n",
    "}\n"
   ]
