   "source": [
    "Categorical variables are, then transformed into factors, which are better suited for handling\n",
    "such data in R. Additionally, the \"GenHealth\" variable is recoded to a Likert scale for correlation\n",
    "matrix computation. The Likert scale, a rating system, used in questionnaires, is designed to\n",
    "measure people’s attitudes, opinions, or perceptions (Jamieson, 2023). The order of the\n",
    "numbers in c(5,2,3,1,4)was chosen in correspondence to “Very good\", \"Fair\", \"Good\",\n",
    "\"Poor\", and \"Excellent\".\n"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 5,
   "id": "b5ffb72c",
