     "exception": false,
     "start_time": "2024-01-21T13:41:46.302518",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Converting categorical variables to factors\n",
    "categorical_vars <- c(\"Smoking\", \"AlcoholDrinking\",\"Sex\", \n",
    "                      \"AgeCategory\", \"Race\", \"PhysicalActivity\", \n",
    "                      \"GenHealth\", \"HeartDisease\")\n",
    "data[categorical_vars] <- lapply(data[categorical_vars], as.factor)"
   ]
  },
