   "source": [
    "# Recoding GenHealth to Likert scale (1-5) for computing the correlation matrix (the order of numbers correspond to \"Very good\", \"Fair\", Good\", \"Poor\", \"Excellent\")\n",
    "data$GenHealth <- factor(data$GenHealth, labels = c(5, 2, 3, 1, 4))\n"
   ]
