   "source": [
    "# Creating a grouped bar chart for binary variables\n",
    "ggplot(binary_data_long, aes(x = variable, fill = value)) +\n",
    "  geom_bar(position = \"stack\", stat = \"count\") +  # Stacking bars, counting occurrences\n",
    "  labs(title = \"Grouped Bar Chart for Binary Variables\",\n",
    "       x = \"Question Types\",\n",
    "       y = \"Count\",\n",
    "       fill = \"Response\") +\n",
    "  scale_fill_manual(values = c(\"Yes\" = \"lightcoral\", \"No\" = \"skyblue\")) +  # Customizing fill colors\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))  # Adjusting x-axis text angle\n"
   ]
