    "\n",
    "# Bar Chart - Distribution of Age Categories\n",
    "ggplot(data, aes(x = AgeCategory, fill = AgeCategory)) +\n",
    "  geom_bar() +\n",
    "  labs(title = \"Distribution of Age Categories\",\n",
    "       x = \"Age Category\",\n",
    "       y = \"Frequency\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))  \n"
   ]
