   "source": [
    "\n",
    "# Bivariate analysis\n",
    "# Box Plot - Physical Health vs. Heart Disease\n",
    "plot1 <- ggplot(data, aes(x = as.factor(HeartDisease), y = PhysicalHealth, fill = HeartDisease)) +\n",
    "  geom_boxplot() +\n",
    "  stat_summary(fun = mean, geom = \"point\", shape = 18, size = 2, color = \"lightcoral\") +\n",
    "  labs(title = \"Physical Health vs. Heart Disease\",\n",
    "       x = \"Heart Disease\",\n",
    "       y = \"Days of Poor Physical Health\") +\n",
    "  theme(legend.position = \"none\")\n",
    "\n",
    "\n",
    "\n",
    "\n",
    "# Box Plot - Mental Health vs. Heart Disease\n",
    "plot2 <- ggplot(data, aes(x = as.factor(HeartDisease), y = MentalHealth, fill = HeartDisease)) +\n",
    "  geom_boxplot() +\n",
    "  stat_summary(fun = mean, geom = \"point\", shape = 18, size = 2, color = \"lightcoral\") +  # Add mean point\n",
    "  labs(title = \"Mental Health vs. Heart Disease\",\n",
    "       x = \"Heart Disease\",\n",
    "       y = \"Days of Poor Mental Health\") +\n",
    "  theme(legend.position = \"none\")\n",
    "\n",
    "\n",
    "\n",
    "#Displaying plot1 and plot2 together\n",
    "combined_plots <- plot1 + plot2\n",
    "combined_plots"
   ]
  },
