    "# Bar Plot - Heart Disease Distribution by Age\n",
    "barplot(table(data$HeartDisease, data$Age), \n",
    "        beside = TRUE, main = \"Heart Disease Distribution by Age\", \n",
    "        xlab = \"Age\", ylab = \"Frequency\", col = c(\"skyblue\", \"lightcoral\"), \n",
    "        legend = c(\"No\", \"Yes\"))\n"
   ]
