   "source": [
    "# Bar Plot - Heart Disease Percentage by Race \n",
    "# Create a table of counts for HeartDisease and Race\n",
    "table_data <- table(data$HeartDisease, data$Race)\n",
    "# Calculate percentages\n",
    "percentage_data <- prop.table(table_data, margin = 2) * 100  # margin=2 calculates percentages by column (Race)\n",
    "# Plot the barplot\n",
    "barplot(percentage_data, beside = TRUE, \n",
    "        main = \"Heart Disease Distribution by Race\", \n",
    "        xlab = \"Race\", ylab = \"Percentage\", \n",
    "        col = c(\"skyblue\", \"lightcoral\"), legend = c(\"No\", \"Yes\"))\n"
   ]
  },
