   "source": [
    "# Stacked Bar Chart - Smoking and Heart Disease\n",
    "# Calculate percentages for Smoking and Heart Disease\n",
    "percentage_data <- prop.table(table(data$Smoking, data$HeartDisease), margin = 1) * 100\n",
    "\n",
    "# Converting the table to a data frame\n",
    "percentage_df <- as.data.frame(percentage_data)\n",
    "\n",
    "# Plotting the Stacked Bar Chart for Smoking and Heart Disease in Percentages\n",
    "ggplot(percentage_df, aes(x = Var1, y = Freq, fill = Var2)) +\n",
    "  geom_bar(stat = \"identity\") +  \n",
    "  labs(title = \"Smoking and Heart Disease (Percentages)\",  \n",
    "       x = \"Smoking\",  \n",
    "       y = \"Percentage\",  \n",
    "       fill = \"Heart Disease\") +  \n",
    "  scale_fill_manual(values = c(\"No\" = \"skyblue\", \"Yes\" = \"lightcoral\")) +  \n",
    "  theme_minimal() +  \n",
    "  geom_text(aes(label = sprintf(\"%.1f%%\", Freq)), position = position_stack(vjust = 0.5))  # Adding text labels to the bars\n"
   ]
  },
