    "Conversely, the graph\n",
    "examining alcohol consumption and heart disease reveals that non-drinkers have a higher\n",
    "percentage of cases (8.8%) compared to drinkers (5.5%). While the reasons cannot be derived\n",
    "from the data, the possible explanation could be the fact that alcohol abstinence is usually\n",
    "advised to people with poor cardiovascular health."
