   "source": [
    "# Stacked Bar Chart - Alcohol Consumption and Heart Disease\n",
    "# Calculating percentages for Alcohol Consumption and Heart Disease\n",
    "percentage_data <- prop.table(table(data$AlcoholDrinking, data$HeartDisease), margin = 1) * 100\n",
    "\n",
    "# Converting the table to a data frame\n",
    "percentage_df <- as.data.frame(percentage_data)\n",
    "\n",
    "# Stacked Bar Chart for Alcohol Consumption and Heart Disease in Percentages\n",
    "ggplot(percentage_df, aes(x = Var1, y = Freq, fill = Var2)) +\n",
    "  geom_bar(stat = \"identity\") +  \n",
    "  labs(title = \"Alcohol Consumption and Heart Disease (Percentages)\",  \n",
    "       x = \"Alcohol Consumption\",  \n",
    "       y = \"Percentage\",  \n",
    "       fill = \"Heart Disease\") +  # Legend label for the fill color\n",
    "  scale_fill_manual(values = c(\"No\" = \"skyblue\", \"Yes\" = \"lightcoral\")) +  # Customizing fill colors\n",
    "  theme_minimal() +  \n",
    "  geom_text(aes(label = sprintf(\"%.1f%%\", Freq)), position = position_stack(vjust = 0.5))  # Adding text labels to the bars\n"
   ]
  },
