   "source": [
    "\n",
    "# Stacked Bar Chart for Sex and Heart Disease in Percentages\n",
    "# Calculating percentages for Sex and Heart Disease\n",
    "percentage_data_sex <- prop.table(table(data$Sex, data$HeartDisease), margin = 1) * 100\n",
    "\n",
    "# Converting the table to a data frame\n",
    "percentage_df_sex <- as.data.frame(percentage_data_sex)\n",
    "\n",
    "# Plotting the Stacked Bar Chart for Sex and Heart Disease in Percentages\n",
    "ggplot(percentage_df_sex, aes(x = Var1, y = Freq, fill = Var2)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Sex and Heart Disease (Percentages)\",\n",
    "       x = \"Sex\",\n",
    "       y = \"Percentage\",\n",
    "       fill = \"Heart Disease\") +  # Set legend label\n",
    "  scale_fill_manual(values = c(\"No\" = \"skyblue\", \"Yes\" = \"lightcoral\")) +\n",
    "  theme_minimal() +\n",
    "  geom_text(aes(label = sprintf(\"%.1f%%\", Freq)), position = position_stack(vjust = 0.5))\n"
   ]
  },
