   "source": [
    "# Multivariate Analysis - Heatmap of Correlations\n",
    "# Correlation matrix shows the pairwise correlations between the variables BMI, PhysicalHealth, MentalHealth, SleepTime, and GenHealth. Each number in the matrix represents the correlation coefficient between the corresponding pairs of variables.\n",
    "data$GenHealth <- as.numeric(as.character(data$GenHealth))\n",
    "cor_vars <- c(\"BMI\", \"PhysicalHealth\", \"MentalHealth\", \"SleepTime\", \"GenHealth\")\n",
    "cor_matrix <- cor(data[, cor_vars])\n",
    "corrplot(cor_matrix, method = \"color\")\n",
    "print(cor_matrix)\n"
   ]
